#define FICHA_6_0_EX_4_COLUMNS 5
#define FICHA_6_0_EX_5_ROWS 5
#define FICHA_6_0_EX_5_COLUMNS 5

void swap_int(int *a, int *b)
{
	int temp;

	temp = *a;
	*a = *b;
	*b = temp;	
}

void array_int_selection_sort(int *arr, const int size)
{
	int i, j, m, temp;
	for (i = 0; i < FICHA_6_0_EX_3_VEC_COUNT; ++i)
	{
		m = i;
		for (j = i; j < FICHA_6_0_EX_3_VEC_COUNT; ++j)
		{
			if (arr[j] < arr[m]) m = j;
		}
		if (i != m) swap_int(&arr[i], &arr[m]);
	}
}


void array_int_bubble_sort(int *arr, const int size)
{
	int i, temp, len;
	len = size;
	do
	{
		for (i = 1; i < len; ++i)
		{
			if (arr[i-1] > arr[i]) swap_int(&arr[i-1], &arr[i]);
		}
		len--;
	} while (len != 0);
}



// Implemente um programa em linguagem C que leia um vetor de 10 números
// inteiros positivos, e um número x. Escreva no écran os valores do vetor que
// são múltiplos do valor x.
void ficha_6_0_ex_1()
{
	int i;
	int vec[FICHA_6_0_EX_1_VEC_COUNT];
	int x;

	console_clear();
	print_statement(
		"Ficha 6.0 - Exercício 1",
		"Implemente um programa em linguagem C que leia um vetor de 10 números\n"
		"inteiros positivos, e um número x. Escreva no écran os valores do vetor que\n"
		"são múltiplos do valor x.\n"
	);
	printf("Insira %d numeros:\n", FICHA_6_0_EX_1_VEC_COUNT);
	for (i = 0; i < FICHA_6_0_EX_1_VEC_COUNT; ++i)
	{
		printf(" Num %d: ", i+1);
		input_get_int_min("", "ATENÇÃO: O numero tem que ser positivo\n", &vec[i], 1);
	}
	printf("\n");
	input_get_int_min("Introduza um numero X: ", "ATENÇÃO: O numero tem que ser positivo\n", &vec[i], 1);
	printf("Números multiplos de %d:\n", x);
	for (i = 0; i < FICHA_6_0_EX_1_VEC_COUNT; ++i)
	{
		if (vec[i] % x == 0)
		{
			printf(" %d> %d\n", i+1, vec[i]);
		}
	}
	printf("\n");
	console_pause();
}


// Implemente um programa em linguagem C que leia um vetor de 15 posições e
// o compacte, ou seja, elimine as posições com valor zero. Para isso, todos os
// elementos à frente do valor zero, devem ser movidos uma posição para trás
// no vetor.
void ficha_6_0_ex_2()
{
	int i, j;
	int vec[FICHA_6_0_EX_2_VEC_COUNT];
	//{
	//	2,0,0,0,5,0,7,9,0,0,5,4,2,4,0
	//};
	int zero_offset;
	int temp;
	
	console_clear();

	printf("Insira %d posições:\n", FICHA_6_0_EX_2_VEC_COUNT);
	for (i = 0; i < FICHA_6_0_EX_2_VEC_COUNT; ++i)
	{
		printf(" Posição %d: ", i+1);
		input_get_int("", &vec[i]);
	}
	printf("\nCompactando...\n\n");
	zero_offset = 0;
	for (i = 0; i < FICHA_6_0_EX_2_VEC_COUNT; ++i)
	{
		if (vec[i] == 0)
		{
			zero_offset++;
		}
		else
		{
			temp = vec[i-zero_offset];
			vec[i-zero_offset] = vec[i];
			vec[i] = temp;
		}
	}
	
	printf("Vetor compactado: \n");
	print_array_int(vec, FICHA_6_0_EX_2_VEC_COUNT);
	printf("\n");
	console_pause();
}


