// Preencha a matriz com 1 na diagonal principal e com 0 nos demais elementos.
// Escreva no écran a matriz obtida.
void ficha_6_0_ex_4()
{
	int matriz[FICHA_6_0_EX_4_ROWS][FICHA_6_0_EX_4_COLUMNS];
	int i, j;

	console_clear();
	print_statement(
		"Ficha 6.0 - Exercício 4",
		"Implemente um programa em linguagem C onde declare uma matriz 5 x 5.\n"
		"Preencha a matriz com 1 na diagonal principal e com 0 nos demais elementos.\n"
		"Escreva no écran a matriz obtida.\n"
	);
	for (i = 0; i < FICHA_6_0_EX_4_ROWS; ++i)
		for (j = 0; j < FICHA_6_0_EX_4_COLUMNS; ++j)
			if (i == j)
				matriz[i][j] = 1;
			else
				matriz[i][j] = 0;
	printf("Matriz Identidade: \n");
	print_matrix((int *)matriz, FICHA_6_0_EX_4_ROWS, FICHA_6_0_EX_4_COLUMNS);
	printf("\n");
	console_pause();
}

// Implemente um programa em linguagem C que leia uma matriz 5 x 5, bem
// como um valor X. O programa deverá fazer uma pesquisa desse valor na
// matriz e, no final, escrever a localização (linha e coluna) onde se encontra ou
// a mensagem de “não encontrado”.
void ficha_6_0_ex_5()
{
	int matriz[FICHA_6_0_EX_5_ROWS][FICHA_6_0_EX_5_COLUMNS];
	int i, j, X;
	int found_i, found_j;

	console_clear();

	printf("Introduza uma matriz: \n");
	for (i = 0; i < FICHA_6_0_EX_5_ROWS; ++i)
		for (j = 0; j < FICHA_6_0_EX_5_COLUMNS; ++j)
		{
			printf(" matriz[%d][%d]: ", i, j);
			scanf("%d", &matriz[i][j]);
		}
	
	printf("Introduza um numero X, para pesquisar e encontrar a sua localização na matriz: ");
	scanf("%d", &X);

	// Pesquisa sequencial
	printf("\n");
	found_i = -1;
	found_j = -1;
	for (i = 0; i < FICHA_6_0_EX_5_ROWS; ++i)
	{
		for (j = 0; j < FICHA_6_0_EX_5_COLUMNS; ++j)
		{
			if (matriz[i][j] == X)
			{
				found_i = i;
				found_j = j;
				break;
			}
		}
		if (matriz[i][j] == X) break;
	}

	// TODO: Pesquisa Binária (Precisa de dar sort à matriz)


	if (found_i < 0 && found_j < 0)
	{
		printf("Não foi encontrado %d na matriz.\n", X);
	}
	else
	{
		printf("Encontrado %d em matriz[%d][%d].\n", X, found_i, found_j);
	}

	console_pause();
}

